import React,{useContext} from 'react';
import {Link} from 'react-router-dom';
import {Grid, Card, Paper, Container }from '@material-ui/core';
import Typography from '@material-ui/core/Typography';
import {PropertyContext} from '../context/context';
import { makeStyles } from '@material-ui/core/styles';
import ButtonBase from '@material-ui/core/ButtonBase';
import img1 from "../images/room-1.jpeg";

const useStyles = makeStyles((theme) => ({
    Head:{
        color: "#F9F3FA"
    },
    Paper:{
        background:"#1C191D",
        borderRadius: 15,
        padding: 8
    },
    image:{
        position: "absolute",
        width: "100%",
        height: 248,
        left: 10,
        top: 10,
        borderRadius: 20
    },
    Image: {
        height: 180,
       
      },
      img: {
        height:'100%',
        borderRadius:5,
        width:"100%",
        margin: 'auto',
        display: 'block',
        maxWidth: '100%',
        maxHeight: '100%',
      },
  }));

export default function PropertyList() {
    const classes = useStyles();
    const context = useContext(PropertyContext)
    const images = context.initialData.map(card => card.images)
    console.log("items", images.map(card=> card[0].url))
    return (
        <Paper className={classes.Paper} >
            <Typography className={classes.Head}>15 Search result</Typography>
            <Grid container spacing={5}>
                {context.initialData.map((card)=>(
                    <Grid item key={card.id} xs={12}  >
                        <div className={classes.root}>
                            <Paper className={classes.paper1} elevation={5}>
                                <Grid container spacing={2} sm={4}>
                                        <Link  to={`/DetailPage/${card.id}`} >
                                            <ButtonBase className={classes.Image}>
                                                <img className={classes.img} alt="complex" src={img1} />
                                            </ButtonBase>
                                        </Link>
                                    <Grid item xs={12} sm={8} container>
                                        <Grid  container>
                                            <Grid item xs container direction="column" spacing={2}>
                                                <Grid item xs>
                                                    <h1 className={classes.Address}>
                                                        {"hi"}
                                                    </h1>
                                                    <p className={classes.publicText}>
                                                        {"hi"}
                                                    </p>
                                                </Grid>
                                            </Grid>
                                            <Grid item>
                                                {/* <NumberFormat className={classes.Price} value={card.ListPrice} displayType={'text'} thousandSeparator={true} prefix={'$'} /> */}
                                                {/* {card.CountyOrParish} */}
                                            </Grid>
                                        </Grid>
                                    </Grid>
                                </Grid>
                            </Paper>
                        </div>
                    </Grid>
                ))}
            </Grid>
        </Paper>
    )
}
